import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import api from '../services/api';

export default function TutorList() {
  const [tutores, setTutores] = useState([]);

  useEffect(() => {
    api.get('/tutores').then((res) => setTutores(res.data));
  }, []);

  return (
    <div className="container my-5">
      <div className="d-flex justify-content-between align-items-center mb-4">
        <h2>Tutores Cadastrados</h2>
        <div>
          <Link to="/" className="btn btn-secondary me-2">← Voltar ao Início</Link>
          <Link to="/tutores/novo" className="btn btn-primary">+ Cadastrar Novo Tutor</Link>
        </div>
      </div>

      {tutores.length === 0 ? (
        <p>Nenhum tutor cadastrado ainda.</p>
      ) : (
        <ul className="list-group">
          {tutores.map((tutor) => (
            <Link
              to={`/tutores/${tutor._id}`}
              key={tutor._id}
              style={{ textDecoration: 'none', color: 'inherit' }}
              className="list-group-item list-group-item-action"
            >
              <strong>{tutor.nome}</strong> – CPF: {tutor.cpf}
            </Link>
          ))}
        </ul>
      )}
    </div>
  );
}
